import React from "react";
import Home from "./routes/Home";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

const App = () => {
	return (
		<div>
			<Router>
				<Switch>
					<Route></Route>
				</Switch>
			</Router>
			<Home />
		</div>
	);
};

export default App;
